      const pValueSequence = bipf.seekKey2(buf, pValue, BIPF_SEQUENCE, 0)
      const author = bipf.decode(buf, pValueAuthor)
      const pFeed = bipf.seekKey2(buf, 0, BIPF_FEED, 0)
      const feedId = pFeed < 0 ? author : bipf.decode(buf, pFeed)
